  TResult? mapOrNull<TResult extends Object?>({
    TResult Function(ChangeScreenType value)? changeScreenType,
    TResult Function(RequestFocusOnInput value)? requestFocusOnInput,
    TResult Function(OnForgotPasswordPressed value)? onForgotPasswordPressed,
    TResult Function(OnAcceptButtonPressed value)? onAcceptButtonPressed,
    TResult Function(CheckUser value)? checkUser,
  }) {
    return checkUser?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(ChangeScreenType value)? changeScreenType,
    TResult Function(RequestFocusOnInput value)? requestFocusOnInput,
    TResult Function(OnForgotPasswordPressed value)? onForgotPasswordPressed,
    TResult Function(OnAcceptButtonPressed value)? onAcceptButtonPressed,
    TResult Function(CheckUser value)? checkUser,
    required TResult orElse(),
  }) {
    if (checkUser != null) {
      return checkUser(this);
    }
    return orElse();
  }
}

abstract class CheckUser implements AuthorizationEvent {
  const factory CheckUser() = _$CheckUser;
}
